function generate() {
    var doc = new jsPDF({
    orientation: 'l',
    unit: 'mm',
    format: 'a4',
    putOnlyUsedFonts:true,
    floatPrecision: 16 // or "smart", default is 16
    });
    var img1 = "data:image/png;base64,"
    doc.addImage(img1, 0, 30, 300, 150)

    doc.addPage("a4","p");
    var img2 = "data:image/png;base64,"
    doc.addImage(img2, 0, 0, 208, 208)
    doc.save('form.pdf');
}